import React from 'react';

const Header = () => {
    return (
        <div className="header">
            <div className="header-wrapper">
                <div className="header-left">
                    <div className="header-logo">logo</div>
                </div>
                <div className="header-right">
                    <ul className="header-menu">
                        <li className="menu-item">Startsida</li>
                        <li className="menu-item">Om mig</li>
                        <li className="menu-item">Kompetens</li>
                        <li className="menu-item">Erfarenhet</li>
                        <li className="menu-item">Portof√∂lj</li>
                        <li className="menu-item">Kontakt</li>
                    </ul>
                </div>
            </div>
        </div>
    );
};

export default Header;
